={{
    [
        $json.data.filter(item => item.accept == 'yes').length > 0 
            ? `We accept health insurance plans: ${$json.data.filter(item => item.accept == 'yes').map(item => `${item.plan}`).join(', ')}.`
            : '',
        $json.data.filter(item => item.accept == 'no').length > 0 
            ? `We do not accept health insurance plans: ${$json.data.filter(item => item.accept == 'no').map(item => `${item.plan}`).join(', ')}.`
            : ''
    ].filter(section => section !== '').join('\n\n') 
}}

